function ShopItemsList(props) {
  return (
    <ul>
      <li>
        <h2>{props.item.name}</h2>
      </li>
      <li>
        <h3>{props.item.description}</h3>
      </li>
      <li>
        <h3>{props.item.price}</h3>
      </li>
      <li>
        <button onClick={props.onBack}>Back</button>
      </li>
    </ul>
  );
}

export default ShopItemsList;
